  `id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `client_id` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `client_name` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `online_count` int(11) DEFAULT NULL,
  `submit_count` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

